Synopsis:

Jab Yaad Kisi Ki Aati Hai is a 1967 film starring Dharmendra, Mala Sinha in a double role, Abhibhattacharya and M. Rajan. It is is love story with little suspense.

This movie has some superhit numbers all of which has been listed in the above poster.

